    public class EasternConf {
        public static void EasternStandingData() {
            //String savePath = "charts\\";
            url = "https://www.cbssports.com/nba/standings/";
            try {
                Connection.Response response = Jsoup.connect(url).execute();
                if (response.statusCode() == 200) {
                    Document document = response.parse();

                // <td class="TableBase-bodyTd TableBase-bodyTd--number "> .778 </td>

                    names = document.select("span.TeamName a");
                    pcts = document.select("td.TableBase-bodyTd.TableBase-bodyTd--number");
                } else {
                    app_logger.info("Page download failed");
                }
            } catch (IOException e) {
                app_logger.error("Error! Page download failed");
            }
        }
    }


    private TableView<StandingsData> createStandingsTable() {
        int j;
        int k;
        int l;
        int m;

        TableView<StandingsData> table = new TableView<>();

        // Kolumna
        TableColumn<StandingsData, String> placeColumn = new TableColumn<>("Place");
        placeColumn.setCellValueFactory(new PropertyValueFactory<>("place"));

        // Kolumna
        TableColumn<StandingsData, String> teamColumn = new TableColumn<>("Team");
        teamColumn.setCellValueFactory(new PropertyValueFactory<>("team"));

        // Kolumna
        TableColumn<StandingsData, String> pointColumn = new TableColumn<>("PCT");
        pointColumn.setCellValueFactory(new PropertyValueFactory<>("point"));

        TableColumn<StandingsData, String> pgameColumn = new TableColumn<>("PPG");
        pgameColumn.setCellValueFactory(new PropertyValueFactory<>("pgame"));

        TableColumn<StandingsData, String> winColumn = new TableColumn<>("Wins");
        winColumn.setCellValueFactory(new PropertyValueFactory<>("win"));

        TableColumn<StandingsData, String> loseColumn = new TableColumn<>("Losses");
        loseColumn.setCellValueFactory(new PropertyValueFactory<>("lose"));

        // Dodaj dane do tabeli
        List<StandingsData> StandingsDataList = new ArrayList<>();

        j = 2;
        k = 4;
        l = 0;
        m = 1;
        for (int i = 0; i < (names.size()) / 2; i++) {
            StandingsDataList.add(new StandingsData(
                    String.valueOf(i+1),
                    names.get(i).text(),
                    pcts.get(j).text(),
                    pcts.get(k).text(),
                    pcts.get(l).text(),
                    pcts.get(m).text()
                    ));
            j = j + 16;
            k = k + 16;
            l = l + 16;
            m = m + 16;
        };

        table.getItems().addAll(StandingsDataList);

        table.getColumns().addAll(placeColumn, teamColumn, pointColumn, pgameColumn, winColumn, loseColumn);

        j = 2;
        k = 4;
        for (int i = 0; i < (names.size()) / 2; i++) {
            System.out.println("Team: " + names.get(i).text());
            System.out.println("Pcst: " + pcts.get(j).text());
            System.out.println("PPG: " + pcts.get(k).text());
            j = j + 16;
            k = k + 16;
        }

        return table;
    }

    public static class StandingsData {
        private final String place;
        private final String team;
        private final String point;
        private final String pgame;
        private final String win;
        private final String lose;
        public StandingsData(String place, String team, String point, String pgame, String win, String lose) {
            this.place = place;
            this.team = team;
            this.point = point;
            this.pgame = pgame;
            this.win = win;
            this.lose = lose;
        }

        public String getPlace() {
            return place;
        }

        public String getTeam() {
            return team;
        }

        public String getPoint() {
            return point;
        }

        public String getPgame() {
            return pgame;
        }

        public String getWin() {
            return win;
        }

        public String getLose() {
            return lose;
        }
    }

    public class MasterChart {
        public static void MasterChartData() {
            url = "https://basketeo.pl/nba/rekordy/druzynowe/druzyna-z-najwieksza-liczba-mistrzostw-ligi-nba";
            try {

                Connection.Response response = Jsoup.connect(url).execute();
                if (response.statusCode() == 200) {
                    Document document = response.parse();

                    dataMaster = document.select("tbody tr td");

                    for (int i = 1; i < (dataMaster.size()); i = i + 3) {
                        System.out.println("info: " + dataMaster.get(i).text());
                        System.out.println();
                        masterTeam.add(dataMaster.get(i).text());
                    }

                    System.out.println(" ");
                    System.out.println(" ");
                    System.out.println(" ");

                    for (int i = 2; i < (dataMaster.size()); i = i + 3) {
                        System.out.println("info: " + dataMaster.get(i).text());
                        System.out.println();
                        ringsAmount.add(dataMaster.get(i).text());
                    }

                } else {
                    app_logger.info("Page download failed");
                }
            } catch (IOException e) {
                app_logger.error("Error! Page download failed");
            }
        }
    }

    public static BarChart<String, Number> createChampionshipChart() {
        // Dane do wykresu
        ObservableList<XYChart.Series<String, Number>> chartData = FXCollections.observableArrayList();

        XYChart.Series<String, Number> series = new XYChart.Series<>();
        for(int i = 0; i < ringsAmount.size(); i++) {
            series.getData().add(new XYChart.Data<>(masterTeam.get(i), Integer.parseInt(ringsAmount.get(i))));
        }

        System.out.println(masterTeam);
        System.out.println(ringsAmount);

        chartData.add(series);

        // Utworzenie osi X i Y
        CategoryAxis xAxis = new CategoryAxis();
        NumberAxis yAxis = new NumberAxis();

        // Utworzenie wykresu kolumnowego
        BarChart<String, Number> barChart = new BarChart<>(xAxis, yAxis);
        barChart.setData(chartData);

        // Ustawienia wykresu
        barChart.setTitle("Najbardziej utytułowane zespoły");
        xAxis.setLabel("Drużyna");
        yAxis.setLabel("Liczba pierścieni");

        app_logger.info("Chart has been succesfully created");

        return barChart;
    }


    public class HeightStats {
        public static void HeightStatsData() {
            url = "https://zkrainynba.com/nba-najnizsi-koszykarze/";
            try {
                Connection.Response response = Jsoup.connect(url).execute();
                if (response.statusCode() == 200) {
                    Document document = response.parse();

                    Elements cardBodyElements = document.select("figure.wp-block-image");

                    System.out.println(cardBodyElements.size());

                    for (int i = 0; i < cardBodyElements.size(); i++) {
                        Elements imgElements = cardBodyElements.get(i).select("img");

                        for (int j = 0; j < 1; j++) {
                            String imgUrl = imgElements.get(j).attr("src");
                            image1 = downloadImage(imgUrl);
                        }
                    }

                } else {
                    app_logger.info("Page download failed");
                }
            } catch (IOException e) {
                app_logger.error("Error! Page download failed");
            }
        }

        private static Image downloadImage(String imgUrl) {
            try {
                byte[] imageData = Jsoup.connect(imgUrl).ignoreContentType(true).execute().bodyAsBytes();
                ByteArrayInputStream inputStream = new ByteArrayInputStream(imageData);
                Image image = new Image(inputStream);
                app_logger.info("Image has been downloaded: " +imgUrl);
                return image;
            } catch (IOException e) {
                app_logger.error("Error! Image has not been downloaded: " +imgUrl);
                return null;
            }
        }

    }

    public class GameEvent {
        public static void GameEventData() {
            url = "https://www.cbssports.com/nba/schedule/";
            try {
                Connection.Response response = Jsoup.connect(url).execute();
                if (response.statusCode() == 200) {
                    Document document = response.parse();

                    eventName = document.select("span.TeamName a");
                    eventData = document.select(".CellGame a ");

                    firstEventName = eventName.get(0).text();
                    secondEventName = eventName.get(1).text();
                    generalEventData = eventData.get(0).text();
                } else {
                    app_logger.info("Page download failed");
                }
            } catch (IOException e) {
                app_logger.error("Error! Page download failed");
            }
        }

    }

